        public void Execute(IServiceProvider serviceProvider)
        {
            #region Standard Initialization
            IPluginExecutionContext context =
                (IPluginExecutionContext)serviceProvider.GetService(typeof(IPluginExecutionContext));

            IOrganizationServiceFactory factory =
                (IOrganizationServiceFactory)serviceProvider.GetService(typeof(IOrganizationServiceFactory));

            ITracingService tracingService =
                (ITracingService)serviceProvider.GetService(typeof(ITracingService));

            #endregion Standard Initialization

            #region Plugin Start
            try
            {
                tracingService.Trace("TrackLean Plugin Called");
                string contactEmail = (string)context.InputParameters["contactEmail"];
                string contractBody = (string)context.InputParameters["contractBody"];
                string fileName = (string)context.InputParameters["fileName"];

                tracingService.Trace("Contact Email " + contactEmail);
                tracingService.Trace("File Name " + fileName);
                //tracingService.Trace("Contract Body =>" + contractBody);

                string agreementId = CreateAgreements(fileName, tracingService);
                tracingService.Trace("Agreement ID =>" + agreementId);
                //string agreementId = "10166";

                string agreementAttachment = AddAttachment(agreementId, contractBody, fileName, tracingService);
                tracingService.Trace("Agreement Attachment => " + agreementAttachment);

                string addSignee = AddSignee(agreementId, contactEmail, tracingService);
                tracingService.Trace("Agreement Signee => " + addSignee);

                string publishAgreement = PublishAgreement(agreementId, tracingService);
                tracingService.Trace("Publish Agreement => " + addSignee);
            }
            catch (Exception ex)  
            {
                if(ex.Message == "1")
                    throw new InvalidPluginExecutionException(OperationStatus.Failed, "Agreement couldn't Created ");
                else if(ex.Message == "2")
                    throw new InvalidPluginExecutionException(OperationStatus.Failed, "Agreement Attachment couldn't added ");
                else if(ex.Message == "3")
                    throw new InvalidPluginExecutionException(OperationStatus.Failed, "Agreement Signee counldn't added ");
                else if(ex.Message == "4")
                    throw new InvalidPluginExecutionException(OperationStatus.Failed, "Agreement counldn't published ");
                else
                    throw new InvalidPluginExecutionException("Something went Wrong! " + ex.Message);
            }
            #endregion Plugin Start  
        }
        
        private static string CreateAgreements(string fileName, ITracingService tracingService)
        {
            string url = "https://api.tracklean.com/trackleanapi/v1/agreements?apikey="+ apikey;
            string requestBody = "{'name': '"+ fileName + "','creator': '"+ creator + "','isDocumentAgreement': true,'webhookCustomerApi':'https://prod-119.westeurope.logic.azure.com:443/workflows/e747ffbea29648d2b639744138264200/triggers/manual/paths/invoke?api-version=2016-06-01&sp=%2Ftriggers%2Fmanual%2Frun&sv=1.0&sig=bk91socXbGDUcyU8wv9FMSasolj4ErLDUPhfOhw0-jU'}";
            string contentType = "application/json";
            string response = SendRequest(url, "POST", null, requestBody, contentType, tracingService);
            Agreement agreementData = new JavaScriptSerializer().Deserialize<Agreement>(response);
            //JavaScriptSerializer serializer = new JavaScriptSerializer();
            //Agreement agreementData = serializer.Deserialize<Agreement>(response);
            tracingService.Trace("In AddSignree => " + agreementData);
            if (String.IsNullOrWhiteSpace(agreementData.id.ToString()))
            {
                throw new InvalidPluginExecutionException(OperationStatus.Failed, "1");
            }
            else
            {
                return agreementData.id.ToString();
            }
            
        }

