        private static string PublishAgreement(string agreementId, ITracingService tracingService)
        {
            tracingService.Trace("In Publish Agreement");
            //string url = "https://api.tracklean.com/trackleanapi/v1/agreements/" + agreementId + "/publish?apikey=" + apikey;
            string url = "https://api.tracklean.com/trackleanapi/v1/agreements/" + agreementId + "/publish?apikey=" + apikey;
            tracingService.Trace("URL IS => " + url);
            string requestBody = "";
            string contentType = "application/json";
           
            string response = SendRequest(url, "POST", null, requestBody, contentType, tracingService);
            tracingService.Trace("In Response => " + response);
            JavaScriptSerializer serializer = new JavaScriptSerializer();
            Agreement agreementData = serializer.Deserialize<Agreement>(response);
            Console.WriteLine("Agreement Publish ID =>" + agreementData.id.ToString());
            tracingService.Trace("Agreement Data is => " + agreementData.ToString());
            if (String.IsNullOrWhiteSpace(agreementData.id.ToString()))
            {
                throw new InvalidPluginExecutionException(OperationStatus.Failed, "4");
            }
            else
            {
                return agreementData.id.ToString();
            }
        }

        #region API Call
        public static string PostRequest(string url, string requestBody, string authHeader, string contentType, ITracingService tracingService)
        {
            return SendRequest(url, "POST", authHeader, requestBody, contentType, tracingService);
        }
        private static string SendRequest(string url, string method, string authHeader, string requestBody, string contentType, ITracingService tracingService)
        {
            try
            {
                Console.Out.WriteLine("IN Sendrequest");
                HttpWebRequest httpWebRequest = (HttpWebRequest)WebRequest.Create(url);
                httpWebRequest.Method = method;
                httpWebRequest.KeepAlive = false;
                httpWebRequest.Headers.Add(HttpRequestHeader.Authorization, authHeader);

                tracingService.Trace("First check {0}",(method == "POST"));
                tracingService.Trace("Second check {0}",(!string.IsNullOrEmpty(requestBody)));
                tracingService.Trace("Third check {0}",(method == "POST" && !string.IsNullOrEmpty(requestBody)));
                if (method == "POST" && requestBody!=null)
                {
                    httpWebRequest.ContentType = contentType;
                    using (var streamWriter = new StreamWriter(httpWebRequest.GetRequestStream()))
                    {
                        streamWriter.Write(requestBody);
                        streamWriter.Flush();
                        streamWriter.Close();
                    }
                }
                ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls12;
                tracingService.Trace("http resquest :{0}", httpWebRequest);
                tracingService.Trace("http resquest 1 :{0}", (HttpWebResponse)httpWebRequest.GetResponse());
                var httpResponse = (HttpWebResponse)httpWebRequest.GetResponse();
                tracingService.Trace("http response :{0}", httpResponse);
                using (var streamReader = new StreamReader(httpResponse.GetResponseStream()))
                {
                    var result = streamReader.ReadToEnd();

                    tracingService.Trace("Request response :{0}",result);
                    return result;
                }
            }
            catch (WebException ex)
            {
                if (ex.Response == null)
                {
                    throw ex;
                }
                var response = ex.Response;
                using (var streamReader = new StreamReader(response.GetResponseStream()))
                {
                    var result = streamReader.ReadToEnd();
                    tracingService.Trace("Request response in  exception :{0}", result);
                    return result;
                }
            }
            catch (Exception ex)
            {
                throw ex;
            }
        }
        #endregion API Call
    }
